import React from "react";
import { Box } from "@chakra-ui/react";
import Navbar from "../Navbar/Navbar";
import QuestionChoice from "../QuestionChoice/QuestionChoice";

const Home = () => {
  return (
    <Box bg ="gray.300">
      
      <Navbar />
      <QuestionChoice />
    </Box>
  );
};

export default Home;
